import React from 'react';
import { Route, Switch, NavLink } from 'react-router-dom'
import Header from './components/Header';
import Shop from './Shop'
import Home from './Home';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="App">

      <Header />
      <Home />
      <Shop />
      <Footer />

    </div>
  );
}

export default App;
